// frontend/src/components/ResumeDetails.js
import React from 'react';

const ResumeDetails = ({ data }) => {
    if (!data) {
        return <p>No resume data to display.</p>;
    }

    const {
        contact_info,
        summary_objective,
        work_experience,
        education,
        skills,
        projects,
        awards_certifications,
        resume_analysis
    } = data;

    // --- FIX HERE ---
    const renderList = (items) => {
        // Ensure items is an array before trying to map it
        if (!Array.isArray(items) || items.length === 0) {
            return <ul><li>N/A</li></ul>;
        }
        return (
            <ul>
                {items.map((item, index) => (
                    <li key={index}>{item}</li>
                ))}
            </ul>
        );
    };
    // --- END FIX ---

    const renderSkillSet = (skillSet) => (
        <ul>
            {skillSet && Object.keys(skillSet).length > 0 ? (
                Object.entries(skillSet).map(([category, skillsArray]) => (
                    <li key={category}>
                        <strong>{category.replace(/_/g, ' ').toUpperCase()}:</strong> {skillsArray && skillsArray.length > 0 ? skillsArray.join(', ') : 'N/A'}
                    </li>
                ))
            ) : (
                <li>N/A</li>
            )}
        </ul>
    );


    return (
        <div className="resume-details">
            <h2>Resume Analysis Result</h2>

            <div className="section">
                <h3>Contact Information</h3>
                <ul>
                    <li><strong>Name:</strong> {contact_info?.name || 'N/A'}</li>
                    <li><strong>Email:</strong> {contact_info?.email || 'N/A'}</li>
                    <li><strong>Phone:</strong> {contact_info?.phone || 'N/A'}</li>
                    <li><strong>LinkedIn:</strong> {contact_info?.linkedin || 'N/A'}</li>
                    <li><strong>GitHub:</strong> {contact_info?.github || 'N/A'}</li>
                    <li><strong>Portfolio:</strong> {contact_info?.portfolio || 'N/A'}</li>
                    <li><strong>Address:</strong> {contact_info?.address || 'N/A'}</li>
                </ul>
            </div>

            {summary_objective && (
                <div className="section">
                    <h3>Summary/Objective</h3>
                    <p>{summary_objective}</p>
                </div>
            )}

            {work_experience && work_experience.length > 0 && (
                <div className="section">
                    <h3>Work Experience</h3>
                    {work_experience.map((job, index) => (
                        <div key={index} style={{ marginBottom: '10px' }}>
                            <h4>{job.title || 'N/A'} at {job.company || 'N/A'} ({job.dates || 'N/A'})</h4>
                            <p>{job.location || ''}</p>
                            {job.description_points && job.description_points.length > 0 && (
                                <ul>
                                    {job.description_points.map((point, i) => (
                                        <li key={i}>{point}</li>
                                    ))}
                                </ul>
                            )}
                        </div>
                    ))}
                </div>
            )}

            {education && education.length > 0 && (
                <div className="section">
                    <h3>Education</h3>
                    {education.map((edu, index) => (
                        <div key={index} style={{ marginBottom: '10px' }}>
                            <h4>{edu.degree || 'N/A'} from {edu.institution || 'N/A'} ({edu.dates || 'N/A'})</h4>
                            <p>{edu.location || ''}</p>
                            {edu.gpa && <p>GPA: {edu.gpa}</p>}
                        </div>
                    ))}
                </div>
            )}

            {skills && (Object.keys(skills).some(key => skills[key] && skills[key].length > 0)) && (
                <div className="section">
                    <h3>Skills</h3>
                    {renderSkillSet(skills)}
                </div>
            )}

            {projects && projects.length > 0 && (
                <div className="section">
                    <h3>Projects</h3>
                    {projects.map((project, index) => (
                        <div key={index} style={{ marginBottom: '10px' }}>
                            <h4>{project.name || 'N/A'}</h4>
                            <p>{project.description || 'N/A'}</p>
                            {project.technologies && project.technologies.length > 0 && (
                                <p><strong>Technologies:</strong> {project.technologies.join(', ')}</p>
                            )}
                        </div>
                    ))}
                </div>
            )}

            {/* Use the fixed renderList function */}
            {awards_certifications && (
                <div className="section">
                    <h3>Awards & Certifications</h3>
                    {renderList(awards_certifications)}
                </div>
            )}

            {resume_analysis && (
                <div className="section">
                    <h3>AI-Powered Analysis</h3>
                    <p><strong>Rating (out of 10):</strong> {resume_analysis.rating_out_of_10 || 'N/A'}</p>
                    <p><strong>General Feedback:</strong> {resume_analysis.general_feedback || 'N/A'}</p>

                    <h4>Strengths</h4>
                    {renderList(resume_analysis.strengths)}

                    <h4>Weaknesses</h4>
                    {renderList(resume_analysis.weaknesses)}

                    <h4>Areas for Improvement</h4>
                    {renderList(resume_analysis.areas_for_improvement)}

                    <h4>Suggested Upskilling Skills</h4>
                    {renderList(resume_analysis.suggested_upskilling_skills)}
                </div>
            )}
        </div>
    );
};

export default ResumeDetails;
